import React from "react";
import Data from "../../datas/logements.json";

function Gallery() {
  return (
    <div className="galleryContainer">
      {Data.map((post) => {
        return (
          <div className="cardContainer">
            <p>{post.title}</p>
            <img src={post.cover} alt="" className="galleryImg" />
          </div>
        );
      })}
    </div>
  );
}

